INSERT INTO `content` (`ContentID`, `fkRouteID`, `Page`, `PageIndex`, `PageContent`, `Deleted`) VALUES
(1, 6, 'History', 0, '<h2 class=\"ql-align-center\"><strong style=\"color: rgb(40, 40, 40);\">Barossa United History</strong></h2><p><br></p><p class=\"ql-align-justify\"><span style=\"background-color: rgb(230, 0, 0);\">In 1989.</span> Rory Champion, Siggy Pihodnya and Julie Andersen got together and decided that it was time that they did something to start soccer for kids in the Barossa region. They started a team up that played only â€œfriendlyâ€ uncompetitive games for their first season. The club was named the Greenock Town Junior Soccer Club and the team was called the Barossa Hotspurs. It was an Under 10 team with players ranging down to 5 year olds. Their games were against Adelaide Hills Association teams.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">In 1990 they played competitive soccer in the Adelaide Hills Association. The first coach was Jeff Taylor, who had experience in English soccer and who was a Physical Education teacher at Nuriootpa High School. Their home ground was at Greenock Recreation Park where an adult team was already based.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">By 1992 there were four teams with a total of 50 players. Club colours were then red, white and black. The team emblem was â€œAngry Chicksâ€. The Under 11\'s team took out the league premiership this year.</p><p class=\"ql-align-justify\">At the end of the 1994 season the Club became an incorporated body and changed to being a member of the Elizabeth and Districts Junior Soccer Association. Reasons included less travel and a perceived stronger competition. In 1995 the club changed its name to Greenock Barossa United Junior Soccer Club. Club colours changed to green, burgundy and black. The Under13 team took out the Div2 Premiership.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">In 1996 the name was changed to Barossa United Junior Soccer Club. There were six teams including a development squad. The club also moved to new grounds due to Greenock Oval being deemed as overworked with Greenock Town seniors also playing there. They moved to the back â€œcricketâ€ oval at Nuriootpa Centennial Park and due to poor drainage also set up a pitch at Nuriootpa High School. As there was no buildings at the oval the club purchased an old Highways Department caravan which they set up as a canteen. The main fundraiser was operating the canteen during the Barossa Hot Air Balloon Regatta.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">By 1997 there were 120 players and the club was looking again for a new pitch due to the ongoing drainage issues and clashes with other sporting clubs wanting to use the grounds. Efforts began to set up a new pitch by the neighbouring existing Scouts Hall area and a â€œmodifiedâ€ pitch nearby. In 1998 the club worked with the Nuriootpa Centennial Park Committee, the Lions Club, the Nuriootpa Cricket Club and the Scouts to finance and build a shared â€œshedâ€ with many volunteer hours involved. The soccer club would use their portion of the shed for clubrooms and storage. In 1999 the new pitch and clubrooms were in full use.</p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">The club has continued to grow with 15 mixed Junior Teams, 1 womenâ€™s senior team and two senior men\'s teams playing the 2018 season. Players come from surrounding areas as far as Owen, Marrabel, Riverton and Eden Valley. Barossa United prides itself on its hospitality to travelling teams, supporters and referees. It also has a culture and reputation for a high level of sportsmanship always achieving highly in the Referees Association Club Award, the Dennis Moore Trophy, basing this success on active parent involvement and a family atmosphere.</p><p class=\"ql-align-justify\"><br></p><p><strong style=\"color: rgb(40, 40, 40);\">Life Members</strong></p><p><br></p><p class=\"ql-align-justify\">Life membership is an honour bestowed on individual Barossa United Junior Soccer Club Members whoâ€™s exceptional, loyal and outstanding service and contribution has provided measurable benefit to the Club over an extended period of time. Honorary Life Membership is the highest recognition that can be awarded onto a member in acknowledgement of their exceptional service and contribution.</p><p><strong>Barossa United Junior Soccer Club Honorary Life Members include:</strong></p><p><br></p><p>Mrs Julie Wigley (Andersen)</p><hr class=\"ql-align-center\"><p>Mr Michael Andersen</p><hr class=\"ql-align-center\"><p>Jan Matthew</p><hr class=\"ql-align-center\"><p>Mr Richard Clarridge</p><hr class=\"ql-align-center\"><p>Mr John Sharman</p><hr class=\"ql-align-center\"><p>Mrs <span style=\"color: rgb(40, 40, 40);\">Sharlene Sharman</span></p><hr class=\"ql-align-center\"><p>Mrs <span style=\"color: rgb(40, 40, 40);\">Linda Leslie</span></p><hr class=\"ql-align-center\"><p>Mr <span style=\"color: rgb(40, 40, 40);\">Pat McNamara</span></p><hr class=\"ql-align-center\"><p>Mr <span style=\"color: rgb(40, 40, 40);\">John Baldwin Snr</span></p><hr class=\"ql-align-center\"><p>Mr <span style=\"color: rgb(40, 40, 40);\">Guy Martin</span></p><hr class=\"ql-align-center\"><p>Mr <span style=\"color: rgb(40, 40, 40);\">Kevin Boyle</span></p><hr class=\"ql-align-center\"><p>Mr <span style=\"color: rgb(40, 40, 40);\">&nbsp;Grant Bell</span></p><hr class=\"ql-align-center\"><p>Mr <span style=\"color: rgb(40, 40, 40);\">Matthew Halman</span></p><hr class=\"ql-align-center\"><p>Mrs <span style=\"color: rgb(40, 40, 40);\">Suzanne Halman</span></p><hr class=\"ql-align-center\"><p>Mrs <span style=\"color: rgb(40, 40, 40);\">Linda Smith</span></p><hr class=\"ql-align-center\"><p>Mr Chris Smith</p><hr class=\"ql-align-center\"><p>Mr <span style=\"color: rgb(40, 40, 40);\">Glenn Van Der Lende</span></p><hr><p> <img class=\"img-fluid\" src=\"data:image/png;base64,\">   <img class=\"img-fluid\" src=\"data:image/jpeg;base64,\">      <img class=\"img-fluid\" src=\"data:image/jpeg;base64,\">     <img class=\"img-fluid\" src=\"data:image/jpeg;base64,\">          <img class=\"img-fluid\" src=\"data:image/png;base64,\"></p>', 0);
INSERT INTO `content` (`ContentID`, `fkRouteID`, `Page`, `PageIndex`, `PageContent`, `Deleted`) VALUES
(2, 8, 'Newsletters', 0, '<h2 class=\"ql-align-center\"><strong>Newsletters</strong></h2><p class=\"ql-align-center\">Barossa United Junior Soccer Club produced Newsletters during the playing season. You can find our previous editions here:</p><h2><br></h2><h2><a href=\"https://express.adobe.com/page/Geca8QAmSUbL6/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\"><strong>October 2021</strong></a>    <a href=\"https://express.adobe.com/page/Geca8QAmSUbL6/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\"><strong>February 2021</strong></a>    <a href=\"https://express.adobe.com/page/ixIXimhjxomQN/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\"><strong>August 2020</strong></a></h2><h2><br></h2><h2><a href=\"https://express.adobe.com/page/aVXPy0SJ27YFC/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\"><strong>September 2019</strong></a>  <a href=\"https://express.adobe.com/page/EohgnCm8k1RLL/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\"><strong>June 2019</strong></a>       <a href=\"https://express.adobe.com/page/I1XBVlyZzgdW7/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\"><strong>April 2019</strong></a></h2><h2><br></h2><h2><a href=\"https://express.adobe.com/page/7cqZUIwj4qe9a/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\"><strong>September 2018</strong></a>   <a href=\"https://express.adobe.com/page/weOPHFNOlWf1w/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\"><strong>August 2018</strong></a>   <a href=\"https://express.adobe.com/page/ZxzEaFhUQaTXr/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\"><strong>July 2018</strong></a><strong> </strong></h2><h2><br></h2><p><br></p><hr><p> <img class=\"img-fluid\" src=\"data:image/png;base64,\">   <img class=\'img-fluid\' src=\"data:image/jpeg;base64,\">      <img class=\'img-fluid\' src=\"data:image/jpeg;base64,\">     <img class=\'img-fluid\' src=\"data:image/jpeg;base64,\">          <img class=\'img-fluid\' src=\"data:image/png;base64,\"></p>', 0);
INSERT INTO `content` (`ContentID`, `fkRouteID`, `Page`, `PageIndex`, `PageContent`, `Deleted`) VALUES
(4, 3, 'Presidents Welcome!', 0, '<h2 class=\"ql-align-center\"><strong>Presidents Welcome</strong></h2><p class=\"ql-align-center\"><br></p><p><span style=\"color: rgb(0, 0, 0);\">Welcome to a unique Barossa United season, delayed due to the COVID-19 pandemic. We are providing a historic first local competition for soccer in the Barossa, commencing Saturday 27 June. Every game will be played at our Nuriootpa home ground. Boys, girls and women will be participating, while our menâ€™s side will play in the Adelaide-based SAASL competition</span></p><p class=\"ql-align-center\"><br></p><p>The ethos of Barossa United continues to be its hallmark â€“ creating opportunities for every interested person possible to participate in the world game. This ethos is at the core of how the B20 competition runs this year. Players of all ages get the maximum enjoyment by everyone helping out, so please ask around how you can help.</p><p><br></p><p>Join us for an exciting experimental format for soccer in the Barossa to get us active and playing again, building our strength for a full season in 2021.</p><p><br></p><p>George Triandafyllidis, President</p><hr><p> <img src=\"data:image/png;base64,\">   <img src=\"data:image/jpeg;base64,\">      <img src=\"data:image/jpeg;base64,\">     <img src=\"data:image/jpeg;base64,\">          <img src=\"data:image/png;base64,\"></p>', 0);
INSERT INTO `content` (`ContentID`, `fkRouteID`, `Page`, `PageIndex`, `PageContent`, `Deleted`) VALUES
(10, 4, 'Fees & Registration', 0, '<h2 class=\"ql-align-center\"><strong style=\"color: rgb(0, 0, 0);\">Season 2022 Fees and Registration Details</strong></h2><p class=\"ql-align-center\"><br></p><p><strong style=\"color: rgb(0, 138, 0);\">Registrations </strong><strong>will open for Season 2022 on October 5th!</strong></p><p><br></p><p>Registrations for the 2022 season is from 5th October 2021 to 5th November 2021.</p><p>Registration fees for the 2022 season have been set by the BUFC Committee at the following:</p><p class=\"ql-indent-1\"><strong>U6 / U7 Local Competition: $60</strong></p><p class=\"ql-indent-1\"><strong>U6 - U8: $195</strong></p><p class=\"ql-indent-1\"><strong>U9 - U17, including the girls\' teams: $230</strong></p><p class=\"ql-indent-1\"><strong>Senior Women and Men: $250</strong></p><p>The above is inclusive of all SAASL / FSA affiliation fees but kit costs are additional.</p><p>Second and subsequent family discount will continue in the 2022 season, this is a 10% discount for second and subsequent family members.</p><p>There is no requirement to pay your 2022 fees now. Invoices will be issued in early 2022.</p><p>Please contact admin@barossaunited.com.au for further enquiries.</p><p>We are looking forward to another amazing season for all our teams.</p><hr><p><span style=\"background-color: rgb(255, 255, 255);\">To register online please visit the&nbsp;</span><a href=\"https://www.revolutionise.com.au/bujsc/registration/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255); color: rgb(40, 40, 40);\">Revolutionise Registration Page</a></p><hr><p><strong>Sports Voucher</strong></p><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\">The Sports Vouchers program is a Government of South Australia initiative administered by the Office for Recreation, Sport and Racing. As part of the State Budget for 2021-22, the Government announced the expansion of Sports Vouches to students in Years 8 and 9. This will commence from 1 January 2022.The program provides an opportunity to receive up to a $100 discount on sports or dance membership/registration fees. The purpose is to increase the number of children playing organised sport or participating in dance activities by reducing cost as a barrier. Once the 2022 sports voucher has been released we will send this to all families to be used against your fees for the 2022 season.</p><p><br></p><p class=\"ql-align-justify\">If using a Sports Voucher the Barossa United Junior Soccer Club require fees to be paid upfront in full, then Club will then facilitate the Sports Voucher refund on your behalf. You can read more about the Sports Voucher Program&nbsp;<a href=\"https://www.sportsvouchers.sa.gov.au/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\">here</a>. You can return the completed form to treasurer@barossaunited.com.au</p><hr><p> <img class=\'img-fluid\' src=\"data:image/png;base64,\">   <img class=\'img-fluid\' src=\"data:image/jpeg;base64,\">      <img class=\'img-fluid\' src=\"data:image/jpeg;base64,\">     <img class=\'img-fluid\' src=\"data:image/jpeg;base64,\">          <img class=\'img-fluid\' src=\"data:image/png;base64,\"></p><p><br></p><p><br></p><p><br></p>', 0);
INSERT INTO `content` (`ContentID`, `fkRouteID`, `Page`, `PageIndex`, `PageContent`, `Deleted`) VALUES
(15, 5, 'Player Info', 0, '<h2 class=\"ql-align-center\"><strong>Player Info</strong></h2><p class=\"ql-align-center\"><br></p><p><strong style=\"color: rgb(0, 0, 0);\">Player Information</strong></p><p><br></p><p>Barossa United Football Club will continue with&nbsp;<a href=\"https://www.footballsa.com.au/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\">Football SA</a>&nbsp;for the 2022 season and beyond. This is building on the success of season 2021.</p><p><br></p><p><strong>Uniform</strong></p><p><br></p><p>Players for the 2022 season will be required to purchase a shirt which has the players name and number on the back.&nbsp;<strong>Players will need to register in the October 5th 2021 to November 5th 2021 window to ensure their spot.</strong></p><p>BUFC uniforms can be ordered from the Black Chrome Web Store&nbsp;<strong>from Thursday 7 October 2021 until midnight 18 November 2021.</strong></p><p><br></p><p><a href=\"https://blackchrome.com.au/shop/barossa-united-football-club-2/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(230, 0, 0);\">Visit the Web store</a><span style=\"color: rgb(40, 40, 40);\"><span class=\"ql-cursor\">ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿ï»¿</span></span></p><p><br></p><p class=\"ql-align-justify\">Existing players can use their current BUFC shorts and socks and are not required to re-order these if still in good condition. Goalie tops purchased in 2021 can continue to be used in 2022.&nbsp;<strong>Home Jersey\'s from 2021 are unable to be used again in 2022 due to team numbers and sponsors changing â€“ as well as kids growing!</strong>&nbsp;We welcome players wearing their 2021 home tops to training though if they wish.</p><hr><p> <img src=\"data:image/png;base64,\">   <img src=\"data:image/jpeg;base64,\">      <img src=\"data:image/jpeg;base64,\">     <img src=\"data:image/jpeg;base64,\">          <img src=\"data:image/png;base64,\"></p>', 0);
INSERT INTO `content` (`ContentID`, `fkRouteID`, `Page`, `PageIndex`, `PageContent`, `Deleted`) VALUES
(18, 7, 'Policies', 0, '<h2 class=\"ql-align-center\"><strong style=\"color: rgb(0, 0, 0);\">Policies</strong></h2><p><br></p><p><strong>Code of Conduct</strong></p><p class=\"ql-align-justify\">To be able to provide all members, spectators, parents and visitors a positive and safe environment, we expect everyone to conduct themselves in a manner worthy of the Barossa United Soccer Club at all times. The role of the Code of Conduct is to outline these expectations to ensure we are providing the best possible environment for children to play Soccer.</p><p>The Code of Conduct includes:</p><ol><li>Members Code of Conduct</li><li>Players Code of Conduct</li><li>Parents &amp; Spectators Code of Conduct</li><li>Child Safe Policy</li><li>Alcohol &amp; Smoking Policy</li><li>Weather Policy</li><li>Vision Correction Equipment Policy</li><li>Wearing of Jewellery</li><li>Communications and Use of Technology</li></ol><hr><p>The full Code Of Conduct can be read&nbsp;<a href=\"https://s3-ap-southeast-2.amazonaws.com/piano.revolutionise.com.au/site/aiemstgd5i8afjmd.pdf\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\">here</a></p><hr><p><strong>Child Safe Environment Policy</strong></p><p class=\"ql-align-justify\">Barossa United Junior Soccer Club is committed to the safety and well-being of all children and young people accessing our Soccer Club and the welfare of the children in our care will always be our first priority. We aim to create a child safe and child friendly environment where all children are valued and feel safe.</p><p class=\"ql-align-justify\">We have appointed Child Safe Officers who are the first point of contact to provide advice and support to children, parents, committee members and volunteers regarding the safety and well-being of children at our Club. Those officers contact details are:</p><h2>    </h2><p>Vicky Ireland                    0422 048 546        <a href=\"mailto:vicepresident@barossaunited.com.au?subject=Barossa%20United%20Childsafe%20Contact\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\">vicepresident@barossaunited.com.au</a></p><p>Kirsty Rosenzweig           0405 485 595        <a href=\"mailto:registrar@barossaunited.com.au?subject=Barossa%20United%20Childsafe%20Contact\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\">registrar@barossaunited.com.au</a></p><p><br></p><hr><p><span style=\"color: rgb(0, 0, 0);\">The full Child Safe Environment Policy can be read&nbsp;</span><a href=\"https://s3-ap-southeast-2.amazonaws.com/piano.revolutionise.com.au/site/yx5iflwaws3hgxee.pdf\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\">here.</a></p><hr><p> <img src=\"data:image/png;base64,\">   <img src=\"data:image/jpeg;base64,\">      <img src=\"data:image/jpeg;base64,\">     <img src=\"data:image/jpeg;base64,\">          <img src=\"data:image/png;base64,\"></p><p><br></p>', 0);
INSERT INTO `content` (`ContentID`, `fkRouteID`, `Page`, `PageIndex`, `PageContent`, `Deleted`) VALUES
(27, 2, 'Home', 0, '<p><strong>Welcome to Barossa United Football Club</strong></p><p>Barossa United Football Club is committed to the positive promotion of soccer for men, women, boys and girls through its teams and development programs.</p><p><strong>Registrations for Season 2022 will open on October 5th! For all registrations,&nbsp;</strong><a href=\"https://www.revolutionise.com.au/bujsc/registration/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\"><strong>click here.</strong></a></p><h1>With Soccer\'s ever growing popularity, the aim of the club is to make the game fun to play, and help our players promote and develop teamwork, positive sporting behaviour and skills in the beautiful game.</h1>', 0),
(32, 0, '', 0, '', 0);
INSERT INTO `content` (`ContentID`, `fkRouteID`, `Page`, `PageIndex`, `PageContent`, `Deleted`) VALUES
(33, 9, 'Contact', 0, '<p><strong style=\"color: rgb(40, 40, 40);\">Barossa United Soccer Club</strong></p><p><span style=\"color: rgb(40, 40, 40);\">The Barossa United Junior Soccer Club grounds are located in Nuriootpa on Barossa Valley Way, within the Nuriootpa Centennial Park precinct.</span></p><p><strong style=\"color: rgb(40, 40, 40);\">Barossa United Junior Soccer Club Facebook:</strong><a href=\"https://www.facebook.com/Barossa-United-Junior-Soccer-Club-118735111946957/\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\">&nbsp;Barossa United FC Facebook</a></p><p class=\"ql-indent-1\"><br></p><hr style=\"color: rgb(33, 37, 41);\"><p><strong style=\"color: rgb(0, 0, 0);\">General Enquiries:</strong><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span><a href=\"mailto:admin@barossaunited.com.au?Subject=Barossa%20United%20Website%20Contact\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\">admin@barossaunited.com.au</a></p><p><strong style=\"color: rgb(0, 0, 0);\">President:</strong><span style=\"color: rgb(0, 0, 0);\">&nbsp;George Triandafyllidis, 0411053151</span></p><p><strong style=\"color: rgb(0, 0, 0);\">Vice President:</strong><span style=\"color: rgb(0, 0, 0);\">&nbsp;Alex Worrall, 0406179177</span></p><p><strong style=\"color: rgb(0, 0, 0);\">Secretary:</strong><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span><a href=\"mailto:admin@barossaunited.com.au?Subject=Barossa%20United%20Website%20Contact\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\">Lisa Ognjanovic</a><span style=\"color: rgb(0, 0, 0);\">, 0410917824</span></p><p><strong style=\"color: rgb(0, 0, 0);\">Senior Mens:</strong><span style=\"color: rgb(0, 0, 0);\">&nbsp;</span><a href=\"mailto:seniors@barossaunited.com.au?Subject=Barossa%20United%20Website%20Contact\" rel=\"noopener noreferrer\" target=\"_blank\" style=\"color: rgb(40, 40, 40);\">Alexander Worrall</a><span style=\"color: rgb(0, 0, 0);\">&nbsp;0406 179 177</span></p><p><strong style=\"color: rgb(0, 0, 0);\">Womens Team:</strong><span style=\"color: rgb(0, 0, 0);\">&nbsp;Chris Smith 0487 164 962</span></p><p><br></p><p><strong style=\"color: rgb(0, 0, 0);\">Postal Address:</strong></p><p><span style=\"color: rgb(0, 0, 0);\">PO Box 775, Nuriootpa, SA 5355</span></p><p><br></p><hr><p> <img class=\"img-fluid\" src=\"data:image/png;base64,\">   <img class=\"img-fluid\" src=\"data:image/jpeg;base64,\">      <img class=\"img-fluid\" src=\"data:image/jpeg;base64,\">     <img class=\"img-fluid\" src=\"data:image/jpeg;base64,\">          <img class=\"img-fluid\" src=\"data:image/png;base64,\"></p><p><br></p>', 0);
